[{
  "key": "Recommendation",
  "value": "Go to https://console.cloud.google.com/sql/instances/realm-rivalry-dev/overview?project\u003ddirect-glider-465821-p7 and verify that the instance is running by looking for a green checkmark icon next to the instance name. If it is not running, then click on the \"START\" button. (The instance must be running in order to perform the next remediation step, but need not remain running afterwards.) Go to https://console.cloud.google.com/sql/instances/realm-rivalry-dev/connections?project\u003ddirect-glider-465821-p7 and the listed SSL settings provide two options. If you want to enforce only the SSL, but not require client certificates click the \"Allow only SSL connections\" button, otherwise if you want to enforce SSL as well as require client certificates click the \"Require trusted client certificates\" button."
},{
  "key": "ExceptionInstructions",
  "value": "Add the security mark \"allow_ssl_not_enforced\" to the asset with a value of \"true\" to prevent this finding from being activated again."
},{
  "key": "Explanation",
  "value": "To avoid leaking sensitive data in transit through unencrypted communications, all incoming connections to your SQL database instance should use SSL. Learn more at: https://cloud.google.com/sql/docs/mysql/configure-ssl-instance"
},{
